@Test
  public void createEntry() {
    CacheEntry<Integer, Integer> cacheEntry = CacheUtils.createEntry(1, 2);
    assertEquals(new Integer(1), cacheEntry.getKey());
    assertEquals(new Integer(2), cacheEntry.getValue());
  }

